import React from 'react';
import ReactDOM from 'react-dom/client';
import{BrowserRouter, Routes, Route} from 'react-router-dom';
import './index.css';
import HomePage from './landing_page/home/HomePage';
import Signup from './landing_page/signup/Signup';
import AboutPage from './landing_page/about/AboutPage'
import ProductPage from './landing_page/products/Productpage'
import PricingPage from './landing_page/pricing/PricingPage';
import SupportPage from './landing_page/support/SupportPage'

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <BrowserRouter>
  <Navbar />
  <Routes>
    <Route path="/" elements={<HomePage/>}/>
    <Route path="/signup" elements={<Signup/>}/>
    <Route path="/about" elements={<AboutPage/>}/>
    <Route path="/product" elements={<ProductPage/>}/>
    <Route path="/pricing" elements={<PricingPage/>}/>
    <Route path="/support" elements={<SupportPage/>}/>
  </Routes>
  <Footer />
  </BrowserRouter>
);
